description:
&quot;Laura (Kaylani Lei) is a cute, hardworking waitress. Josh (Ryan Driller) is a handsome, famous actor. When Josh spots her from across a crowded nightclub, he's hooked at first sight! Although they come from very different worlds, it doesn't matter, as the pair share an undeniable attraction and spend the entire night together. Unfortunately, the following morning Josh must leave town to work on a film, and they begin an intense, long-distance relationship. About to be reunited, Laura discovers a secret that Josh has been keeping. Will he be able to convince her of the truth or will it be too late to save the relationship?&quot;

Kaylani Lei, Ryan Driller, Allison Moore, Presley Hart, Sarah Shevon, Steven St. Croix, Xander Corvus

